import React, { Component } from 'react';
import '../css/SocialFollow.css';

class SocialFollow extends Component{
    render(){
      const facebookLink = "https://www.facebook.com/DynamicsPerformanceTeam/";
      const instagramLink = "https://www.instagram.com/dynamicsperformanceteam/?hl=en";
      const yelpLink = "https://www.yelp.com/biz/dynamics-performance-team-san-jose";
      const mailLink = "https://www.google.com";
      const facebookIcon = "fab fa-facebook-f";
      const instagramIcon = "fab fa-instagram";
      const yelpIcon = "fab fa-yelp";
      const mailIcon = "../images/email.png";
      return(
          <div className="Social">
            <ul>

              <SocialIcon platformLink={facebookLink} icon={facebookIcon}/>
              <SocialIcon platformLink={instagramLink} icon={instagramIcon}/>
              <SocialIcon platformLink={yelpLink} icon={yelpIcon}/>

              <SocialIcon platformLink={mailLink} icon={mailIcon}/>


            </ul>
          </div>
      );
    }
}

const SocialIcon = props => (
  <li>
    <a href={props.platformLink} class={props.icon} ></a>
  </li>
); 

export default SocialFollow;
